(1, 'Debug  Tool', '<p>Use&nbsp;<span style=\"color:#FF0000;\"><strong>dd($data, true/false)&nbsp;</strong></span>to preview data for debugging</p>\r\n\r\n<p><strong>$data </strong>&nbsp; &nbsp;: &nbsp; &nbsp;Array / String<br />\r\n<strong>true</strong>&nbsp; &nbsp; &nbsp; &nbsp;: &nbsp; &nbsp; Exit after printing<br />\r\n<strong>false</strong>&nbsp; &nbsp; &nbsp; : &nbsp; &nbsp; Continue after printing</p>\r\n', NULL, '2017-09-18 12:33:33', NULL, '2017-09-18 18:38:02', 'Active'),
(3, 'Master Entry', '', NULL, '2017-09-18 12:28:41', NULL, '2017-09-18 18:38:00', 'Active'),
(5, 'Flashdata', '<ul>\r\n	<li>Call a object function only for display flashdata on popup</li>\r\n	<li>use parameter for displaying theme anda message</li>\r\n</ul>\r\n\r\n<pre class=\"prettyprint\">\r\n<strong>$this-&gt;setFlashData(THEME_NAME, MESSAGE);\r\n</strong>\r\n// THEME_NAME : danger/info/success\r\n// MESSAGE    : Action has been executed Successfully\r\n</pre>\r\n', NULL, '2017-09-18 12:01:30', NULL, '2017-09-18 18:12:48', 'Active'),
(6, 'Confirm Dialogue', '<ul>\r\n	<li>Use only for href link to use confirm action</li>\r\n</ul>\r\n\r\n<pre class=\"prettyprint\">\r\n<strong>&lt;a class=&quot;<span style=\"color:#FF0000;\">confirm-link</span>&quot; href=&quot;GIVEN_LINK&quot;&gt;&lt;i class=&quot;fa fa-close&quot;&gt;&lt;/i&gt;&lt;/a&gt;\r\n</strong>\r\n// confirm-link is for confirm dialogue\r\n// GIVEN_LINK : action url\r\n</pre>\r\n', NULL, '2017-09-18 12:05:41', NULL, '2017-09-18 18:06:51', 'Active'),
(7, 'Dynamic Label Change', '<ul>\r\n	<li>After double click label can be changed if user wants</li>\r\n	<li>Use this kind of text to change the text</li>\r\n	<li>usnig &nbsp;&quot;<strong>labelchange</strong>&quot; class&nbsp;</li>\r\n</ul>\r\n\r\n<pre class=\"prettyprint\">\r\n&lt;span class=&quot;<strong>labelchange</strong>&quot; id=&quot;<span style=\"color:#FF0000;\">&lt;?= $base_name; ?&gt;</span>&quot;&gt;\r\n        <span style=\"color:#FF0000;\">&lt;?= defined($base_name) ? constant($base_name) : $base_name; ?&gt; </span>\r\n&lt;/span&gt;</pre>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, '2017-09-18 12:19:39', NULL, NULL, 'Active');
